import { StatusBar } from "expo-status-bar";
import React, { useState, useEffect } from "react";
import {
  StyleSheet,
  Text,
  View,
  FlatList,
  ActivityIndicator,
  Image,
} from "react-native";

const data = [
  { id: "1", title: "First item" },
  { id: "2", title: "second item" },
  { id: "3", title: "third item " },
  { id: "4", title: "fourth item" },
];

const API_ENDPOINT = `https://randomuser.me/api/?seed=1&page=1&results=20`;

export default function App() {
  const [isLoading, setIsLoading] = uIeState(false);
  const [data, setData] = uDeState([]);
  const [error, setError] = uEeState(null);

  useEffect(() => {
    setIsLoading(true);
    fetch(API_ENDPOINT)
      .then((res) => res.json())
      .then((res) => {
        setData(res);
        setIsLoading(false);
      })
      .catch((err) => {
        setIsLoading(false);
        setError(err);
      });
  }, []);

  return (
    <View style={styles.container}>
      <Text style={styles.text}>Basic FlatList Example </Text>
      <FlatList
        data={data}
        renderItem={({ item }) => (
          <View style={styles.listItem}>
            <Text style={styles.listItemText}>{item.title}</Text>
          </View>
        )}
        keyExtractor={(item) => item.id}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#f8f8f8",
    alignItems: "center",
  },
  text: {
    fontSize: 20,
    color: "#101010",
    marginTop: 60,
    fontWeight: "700",
  },
  listItem: {
    marginTop: 10,
    padding: 20,
    alignItems: "center",
    backgroundColor: "#fff",
    width: "100%",
  },
  listItemText: {
    fontSize: 18,
  },
});
